import React from "react";
import "./App.css";

import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="container fluid=md">
      <div class="row">
        <div className="col-sm">
          <h1>Hello world!!</h1>
        </div>
      </div>
      <div class="row">
        <div class="col-sm">
          <input type="text" name="id" />
        </div>
        <div class="col-sm">
        <input type="text" name="name" />
        </div>
      </div>
    </div>
  );
}

export default App;
